DROP PROCEDURE IF EXISTS `getCategoryOfRecipes`;
DELIMITER |
CREATE PROCEDURE `getCategoryOfRecipes`(
_catid varchar(255))
BEGIN
select distinct(r.category) from tblCateringdish cd inner join
tblRecipe r on cd.recipeid=r.recipeid where cd.catid=_catid
order by  Case r.category
when 'Appetizer' then 1
when 'Bread Service' then 2
when 'Soup' then 3
when 'Salad' then 4
when 'Pasta' then 5
when 'Main dish' then 6
when 'Kiddie Meal' then 7
when 'Rice' then 8
when 'Dessert' then 9
when 'Cake' then 10
when 'Drinks' then 11
when 'Crew meal' then 12
when 'Others' then 13
end asc;
END |
DELIMITER ;

