DROP PROCEDURE IF EXISTS `showReport`;
DELIMITER |
CREATE PROCEDURE `showReport`(
_dateF varchar(255),
_dateT varchar(255),
_statu varchar(255))
BEGIN
select _datef as datef,
_datet as datet,
tco.ClientName,
(tco.vip+tco.guest+tco.kids+tco.crew+tco.others) as Total_PAX,
sum(price) as Total_Expense,
tco.DateOfEvent,
tco.PlaceOfevent,
tco.TypeOfService,
tco.catid
from tblcateringOrder tco inner join
tblCateringdish cd on tco.catid = cd.catid
where
tco.status not in (_statu) and
tco.status <> "CANCELLED" and
date(dateofevent) between date(_dateF) and date(_dateT)
group by tco.catid order by tco.dateofevent asc;
END |
DELIMITER ;

DROP PROCEDURE IF EXISTS `showReportByEvent`;
DELIMITER |
CREATE PROCEDURE `showReportByEvent`(
_events varchar(255))
BEGIN
select tco.catid as datef,
tco.vip as datet,
tco.ClientName,
(tco.vip+tco.guest+tco.kids+tco.crew+tco.others) as Total_PAX,
sum(price) as Total_Expense,
tco.DateOfEvent,
tco.PlaceOfevent,
tco.TypeOfService,
tco.catid
from tblcateringOrder tco inner join
tblCateringdish cd on tco.catid = cd.catid
where
FIND_IN_SET(tco.catid,_events)
group by tco.catid order by tco.dateofevent asc;
END |
DELIMITER ;

